import React, { useState, useEffect } from "react";
import {Line} from "react-chartjs-2";

function Chart() {
    const [chartData, setChartData] = useState({})

    const chart = () => {
        setChartData({
            labels: ["Monday", "Tuesday", "Wednesday", "Thursday", "Friday"],
            datasets: [
                {
                    label: "Temperatures in deg-F",
                    data: [82, 85, 70, 69, 89],
                    backgroundColor: [
                        "rgba(75, 192, 192, 0.6)"
                    ],
                    borderWidth: 5
                }
            ]
        })
    }

    useEffect(() => {
        chart()
    }, [])

    return (
        <div>
            <h1>F1 Fantasy Prices</h1>
            <div>
                <Line data={chartData} />
            </div>
        </div>
    );
}

export default Chart;
